import React from 'react';
import Home from '../Home';
// import Presentation from '../Presentation';
// import Projects from '../Projects';
import Skills from '../Skills';
// import Experience from './components/Experience';
import "../styles/main.css";

const Main = () => {
  return (
    <>
        <header>
          <nav>
            <ul>
              <li><a href="#home">Accueil</a></li>
              <li><a href="#about">À propos</a></li>
              <li><a href="#experience">Experience</a></li>
              <li><a href="#contact">Contact</a></li>
            </ul>
          </nav>
        </header>
        <section class="text-gray-600 body-font">
          <section id="about">
            <Home
            prenom={"Merwan"}
            nom={"Laakad"}
            metier={"Dev. Fullstack"}
            presentation={"Bienvenue sur mon portfolio, je suis un développeur Fullstack, âgé de 22 ans. Passionné par le développement web, je suis spécialisé dans la création d'applications à la fois front-end et back-end."}

            />
          </section>

          <section id="experience">
            <Skills
              nomEntreprise={"WhenToCop?"}
              contrat={"Alternance"}
              metier={"Developpeur Fullstack"}
              dateDeDebut={"nov. 2022"}
              dateDeFin={"Aujourd'hui"}

            />
          </section>

          <section id="experience">
            <Skills
              nomEntreprise={"Optim'Ism"}
              contrat={"Stage"}
              metier={"Developpeur Web"}
              dateDeDebut={"janv. 2021"}
              dateDeFin={"févr. 2021 "}

            />
          </section>

          <section id="projects">
            <h2>Mes Projets</h2>
            <div class="project">
              <h3>Projet 1</h3>
              <p>Description du projet 1.</p>
            </div>
            <div class="project">
              <h3>Projet 2</h3>
              <p>Description du projet 2.</p>
            </div>
          </section>

        </section>
      <footer>
        <p>&copy; 2023 Mon Portfolio. Tous droits réservés.</p>
      </footer>
    </>
  );
};

export default Main;
